    var db = firebase.firestore();
    var sourceName = (
        db.collection("NBASources")
        .doc("n7CnddtjJjthvX9O5WcC")[0]
    )
    console.log(sourceName);
    return(
        <div className="TierItem">
            <h1>1</h1>
            <p>{sourceName}</p>
        </div>
    )
}

export default Tier1;
